import React from "react";
import "./contact.css";
import { Link } from "react-router-dom";

class Contact extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="text-center position-static">
          <div className="position-absolute top-50 start-50 translate-middle">
            <h1>CONTACT</h1>
            <h3>
              If you want to reach me out, feel free to send me a message on
              LinkedIn!
            </h3>
            <h4>Click the icon below to do so</h4>
            <a
              href="https://www.linkedin.com/in/lautaronasello/"
              target="_blank"
              rel="noopener noreferrer"
            ></a>
            <img
              src="https://jesuslencina.vercel.app/assets/contact/linkedin.png"
              alt="LinkedIn"
              srcset=""
            />
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default Contact;
